import * as React from 'react';
import { BasicCard} from './Components/Card'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <BasicCard title='Personal Website' content='this is a test' link='https://google.com'/>
      </header>
    </div>
  );
}

export default App;
